A different way of training on my bike that I enjoy a lot! Thanks to @lucaloku for following me and filming me!

Une manière différente de m'entraîner sur mon vélo que j'apprécie beaucoup! Merci à @lucaloku de m'avoir suivi et filmé !

@borahansgrohe @iamspecialized Specialized @sportful @ride100percent

Happy to have spent a week of intense and exciting racing in the Netherlands and Belgium. Thanks to the @beneluxtour organization and to the thousands of fans that cheered every day. Next race, the European Road Championship a week from today.

Heureux d'avoir passé une semaine de courses intenses et passionnantes aux Pays-Bas et en Belgique. Merci à l'organisation du @beneluxtour et aux milliers de fans qui nous ont supportés chaque jour. Prochaine course, le Championnat d'Europe sur Route, dimanche prochain.

@borahansgrohe @boracookingsystems @hansgrohe @iamspecialized @sportful @ride100percent (Photos @bettiniphoto)

Very demanding stage today at the @beneluxtour, it felt like an Ardennes classic on a hot day! Congratulations to @sonnycolbrelli for his powerful victory.

Une étape très exigeante aujourd'hui au @beneluxtour, c'était comme une Ardennaise pendant une chaude journée. Félicitations à @sonnycolbrelli pour sa puissante victoire. 

@borahansgrohe (Photos @bettiniphoto)

It was a long stage that played out as expected. Once more, we worked well as a team and I was at the front of the peloton in the final circuit in order to control and close the attacks. It served as a good indicator of my form after my knee injury and my altitude training. In the sprint finish, I gave my best.

Cela a été une longue étape qui s'est déroulée comme prévu. Une fois de plus, l'équipe a bien travaillé et je me trouvais en tête du peloton dans le circuit final pour contrôler et chasser les attaques. Ceci a servi de bon indicateur de ma forme après ma blessure au genou et mon stage en altitude. J'ai tout donné au sprint final.

@beneluxtour @borahansgrohe (Photo @bettiniphoto)

Another fast stage where we worked well to keep the breakaway under control and finish with a bunch sprint. In the final kilometers, I was positioned at the front of the peloton in order to avoid any problems and be ready for the finale. Unfortunately, just before the final sprint started, I didn't have a clear lane that would have allowed me to accelerate as much as I could, so I wasn't able to go for the win.

Une autre étape rapide où nous avons bien travaillé pour contrôler l'échappée et s'assurer d'une arrivée avec un sprint massif. Dans les derniers kilomètres, j'étais positionné en tête du peloton afin d'éviter tous problèmes et d'être prêt pour la finale. Malheureusement, juste avant le début du sprint final, je n'avais pas de voie libre qui m'aurait permis d'accélérer autant que je le pouvais et par conséquent je n'ai pas pu me battre pour la victoire.

@beneluxtour @borahansgrohe (Photo @bettiniphoto)

One of my favorite moments of the day, meeting with the fans!

Un de mes moments préférés de la journée, aller à la rencontre des spectateurs !

@beneluxtour @borahansgrohe

I felt well in today's fast stage. It was important to stay at the front of the bunch as much as possible in order to avoid getting caught in any crashes. Unfortunately, Wilco went down, so that is a hit for us. The breakaway was close to getting caught but there were a few mechanicals in the finale, so the sprinter teams weren't always pulling. I had good legs in the bunch sprint and we'll try again tomorrow.

Je me sentais bien dans l'étape rapide d'aujourd'hui. Il était important de rester le plus longtemps possible en tête du peloton afin d'éviter d'être piégé par des chutes. Malheureusement, Wilco a chuté et cela est un coup pour nous. L'échappée était sur le point d'être rattrapée mais il y avait quelques probèmes mécaniques dans la finale, donc les équipes des sprinteurs ne travaillaient pas tout le temps. J'avais de bonnes jambes au sprint du groupe et nous réessayerons demain.

@beneluxtour @borahansgrohe (Photos @bettiniphoto)
